const changePage = (pageName) => {setPage(pageName)}
const switchPage = () => {
  switch (page) {
    case "":
      return;

      case "emergency":
        return <EmergencyPage />

     case "window":
      return <NameWindow user = {props.user}/>

      // case "ambulance":
